define({
    inputs: {
        group: "reference",
        filter: "string"
    },
    setup: function(inputs, outputs) {
        // Create container for icon components.
        inputs.group.iconcontainer = [];
    },
    run: function(inputs, outputs) {
        function addIcon(group, path) {
            // Function for adding a image icon component to group.
            var img = Noodl.createComponent("IconImage");
            img.setInputValue("Image Path", path);
            img.setInputValue("Visible", true);
            console.log(group.iconcontainer);
            group.iconcontainer.push(img);
            group.addChild(img);
        }

        // Remove old icons.
        for(var i = 0; i < inputs.group.iconcontainer.length; i++) {
            inputs.group.removeChild(inputs.group.iconcontainer[i]);
        }
        inputs.group.iconcontainer = [];

        if(inputs.filter) {
            // Get filter.
            var filter = JSON.parse(inputs.filter);

            // Add icons.
            //debugger;
            if(filter.hasOwnProperty("fish") && (filter["fish"] === true)) { addIcon(inputs.group, "Assets/icons/fish.png") }
            if(filter.hasOwnProperty("italian") && (filter["italian"] === true)) { addIcon(inputs.group, "Assets/icons/italian.png") }
            if(filter.hasOwnProperty("vegetarian") && (filter["vegetarian"] === true)) { addIcon(inputs.group, "Assets/icons/vegtarian.png") }
            if(filter.hasOwnProperty("asian") && (filter["asian"] === true)) { addIcon(inputs.group, "Assets/icons/asian.png") }
            if(filter.hasOwnProperty("fastFood") && (filter["fastFood"] === true)) { addIcon(inputs.group, "Assets/icons/fastfood.png") }
            if(filter.hasOwnProperty("fika") && (filter["fika"] === true)) { addIcon(inputs.group, "Assets/icons/fika.png") }
            if(filter.hasOwnProperty("alcohol") && (filter["alcohol"] === true)) { addIcon(inputs.group, "Assets/icons/drink2.png") }
            if(filter.hasOwnProperty("smoking") && (filter["smoking"] === false)) { addIcon(inputs.group, "Assets/icons/nosmoke.png") }
        }
    }
});

